from scipy.interpolate import RectBivariateSpline
import numpy as np
import re


def parse_data(text):
    pattern = r"MicPos:\s*\[([-.\d]+),\s*([-.\d]+),\s*[-.\d]+\].*?A-weighted SPL:\s*([\d.]+)"
    matches = re.findall(pattern, text)
    data = np.array(matches, dtype=float)
    return data


data = parse_data(text10)
x, y, z = data[:, 0], data[:, 1], data[:, 2]

# Make unique sorted coordinate arrays
x_unique = np.unique(x)
y_unique = np.unique(y)

# Reshape z into a grid (len(x_unique) Ã— len(y_unique))
Z = np.full((len(x_unique), len(y_unique)), np.nan)
for i, xi in enumerate(x_unique):
    for j, yj in enumerate(y_unique):
        mask = (x == xi) & (y == yj)
        if np.any(mask):
            Z[i, j] = z[mask][0]

# Build bicubic interpolator (k=3 -> cubic)
interp = RectBivariateSpline(x_unique, y_unique, Z, kx=3, ky=3)

# Example usage:
xq, yq = 5.0, 9.0
spl_val = interp(xq, yq)[0, 0]
dSPL_dx = interp(xq, yq, dx=1, dy=0)[0, 0]
dSPL_dy = interp(xq, yq, dx=0, dy=1)[0, 0]

print("SPL:", spl_val)
print("dSPL/dx:", dSPL_dx)
print("dSPL/dy:", dSPL_dy)
